import React, { useState } from 'react';
import Information from '../components/Information'
import Content from '../components/Content'
import workExamples from "../workExamples"
import Rugby from "../Rugby"
import AFL from "../AFL"
import CK from "../CK"
import Ty from "../Ty"
import OGI from "../OGI"


const Home = (props) => {
    const [selectedTitle, newTitle] = useState(0);

    function handleChange(event)
    {
        //const newValue = event.target.value;

        //newTitle(newValue);
        console.log(event.target.value);
    }
    
    return (
        <div>
            <Information 
                title = {workExamples[selectedTitle].title}
                position={workExamples[selectedTitle].position}
                description={workExamples[selectedTitle].description}
                platform1={workExamples[selectedTitle].platform1}
                platform2={workExamples[selectedTitle].platform2}
                platform3={workExamples[selectedTitle].platform3}
                platform4={workExamples[selectedTitle].platform4}
                platform5={workExamples[selectedTitle].platform5}
            />
            <div className = "Container">
                <div className="dictionary" onClick={handleChange} value={props.id}>
                {Rugby.map((props) => (
                    <Content
                        images={props.image}
                    />
                ))}
                </div>

                <div className="dictionary" onClick={handleChange} value={props.id}>
                {AFL.map((props) => (
                    <Content
                        images={props.image}
                    />
                ))}
                </div>

                <div className="dictionary" onClick={handleChange} value={props.id}>
                {Ty.map((props) => (
                    <Content
                        images={props.image}
                    />
                ))}
                </div>

                <div className="dictionary" onClick={handleChange} value={props.id}>
                {CK.map((props) => (
                    <Content
                        images={props.image}
                    />
                ))}
                </div>

                <div className="dictionary" onClick={handleChange} value={props.id}>
                {OGI.map((props) => (
                    <Content
                        images={props.image}
                    />
                ))}
                </div>
            </div>
        </div>
    )
}

export default Home;
